import React, { Component } from 'react';
import '../App.css';


class About extends Component {
  render() {
    return (

      <div >


<div class="container-fluid" id="aboutdiv">


<div class ="row">
<div class="col">
<p class="text-left" id="helloheading2">About Me</p>
</div>
</div>
<div className="container" id="floatingblock" >
<div class ="row">
<div class="col-lg-6 col-md-6 col-sm-12 col-xs-12">
<p class="text-left" id="singlepara">“My name is Lucas Martin, and I enjoy meeting new people and finding ways to help them have an uplifting experience. I have had a variety of customer service opportunities, through which I was able to have fewer returned products and increased repeat customers, when compared with co-workers. I am dedicated, outgoing, and a team player. Who could I speak with in your customer service department about your organization’s customer service needs?”</p>
</div>
</div>

<div class="container" id="footer">  </div>
</div>
</div>
</div>
    );
  }
}

export default About;
